import React from 'react';
import { TableRow, TableCell, Button } from '@mui/material';
import InputField from '../InputField';

const TableRowComponent = ({ row, onChange, onDelete }) => {
  const handleInputChange = (field) => (event) => {
    onChange(field, event.target.value, row.id);
  };

  return (
    <TableRow>
      {Object.entries(row).map(([key, value]) => {
        if (key !== 'id') {  // Exclude 'id' from being editable
          return (
            <TableCell key={key}>
              <InputField value={value} onChange={handleInputChange(key)} type={key === 'phoneRecipient' ? 'tel' : 'text'} />
            </TableCell>
          );
        }
        return null;
      })}
      <TableCell>
        <Button onClick={() => onDelete(row.id)} color="secondary" variant="contained">
          Удалить
        </Button>
      </TableCell>
    </TableRow>
  );
};

export default TableRowComponent;
